Targeted Investments Asset selection is a central component of our overall investment approach. Our investments consist predominantly of Agency RMBS which, in addition to carrying a GSE or U.S. Government guarantee against loss of principal, are considered a cornerstone of the U.S. financial system. The $9 trillion Agency market plays a vital role in providing liquidity to homeowners and prospective homeowners to purchase or refinance homes.

