Risks Related to Our Investment and Portfolio Management Activities
Spread risk is inherent to our business as a levered investor in Agency RMBS. When the market spread between the yield on our assets and the yield on benchmark interest rates linked to our interest rate hedges widens, our tangible net book value will typically decline. We refer to this as "spread risk". As a levered investor primarily in fixed-rate Agency RMBS, spread risk is an inherent component of our business. Although we use hedging instruments to attempt to protect against moves in interest rates, our hedges will typically not protect us against spread risk.

•disruptions in the repo market generally or the infrastructure that supports it;
•higher short-term interest rates;
•a decline in the market value of our investments available to collateralize borrowings;
•increases in the "haircut" lenders require on the value of our assets under repurchase agreements, resulting in higher collateral requirements;
•increases in member specific margin requirements assessed by the FICC for tri-party repo accessed by our wholly-owned captive broker-dealer subsidiary, BES, through the FICC's GCF Repo service;
•regulatory capital requirements or other limitations imposed on our lenders that negatively impact their ability or willingness to lend to us;
•an exit by lenders from the market;
•circumstances that could result in our failure to satisfy covenants, leverage limits, or other requirements imposed by our lenders, in which case our lenders may terminate and cease entering into repurchase transactions with us; and
•the inability of BES to continually meet FINRA and FICC regulatory and membership requirements, which may change over time.
Because of these and other factors, there is no assurance that we will be able to secure financing on terms that are acceptable to us. If we cannot obtain sufficient funding on acceptable terms, we may have to sell assets possibly under adverse market conditions.
Our borrowing costs may increase at a faster pace than the yield on our investments. Our borrowing costs are particularly sensitive to changes in short-term interest rates, as well as overall funding availability and market liquidity, whereas the yield on our fixed rate assets is largely influenced by longer-term rates and conditions in the mortgage market. Consequently, our borrowing costs may rise at a faster pace or decline at a slower pace than the yield on our assets, negatively impacting our net interest margin.

•the cost of interest rate hedges;
•the degree to which the interest rate hedge benchmark rate correlates to the interest rate risk being hedged;
•the degree to which the duration of the hedge matches that of the related asset or liability, particularly as interest rates change;
•the amount of income that a REIT may earn from hedging transactions that do not satisfy certain requirements of the Internal Revenue Code or that are not done through a TRS; and
•the degree to which the value of our interest rate hedges changes relative to our assets as a result of fluctuations in interest rates, passage of time, or other factors. Additionally, regulations adopted by the CFTC and regulators of other countries could adversely affect our ability to engage in derivative transactions or impose increased margin requirements and require additional operational and compliance costs. Consequently, our hedging strategies may fail to protect us from loss and could even result in greater losses than if we had not entered in the hedge transaction.

