•actions by stockholders, individually or collectively;
•additions or departures of key management personnel;
•speculation in the press or investment community;
•actual or anticipated changes in our dividend policy; and
•changes to our targeted investments or investment guidelines.
We have not established a minimum dividend payment level and may be unable to pay dividends in the future. We intend to pay monthly dividends to our common stockholders in an amount that all or substantially all our taxable income is distributed within the limits prescribed by the Internal Revenue Code. However, we have not established a minimum dividend payment level and the amount of our dividend may fluctuate. Our ability to pay dividends may be adversely affected by the risk factors described herein. All distributions will be made at the discretion of our Board of Directors and will depend on our earnings and financial condition, the requirements for REIT qualification and such other factors as our Board of Directors deems relevant from time to time. Additionally, our preferred stock has a preference on dividend payments and liquidating distributions that could limit our ability to pay dividends to the holders of our common stock. Therefore, we may not be able to make distributions in the future or our Board of Directors may change our dividend policy.

